import styles from './index.less'

export default class Footer extends React.Component {
  render() {
    return (
      <>
        <footer className="footer-wrap">
          <div className="w">

          </div>
        </footer>
        <style jsx>
          {
            styles
          }
        </style>
      </>
    )
  }
}
